import React from 'react';
import styles from './SearchBox.module.scss';

const SearchBox = () => {
  const onClick = () => {
    alert('Iniciar búsqueda');
  };
  return (
    <div className={styles.searchContainer}>
      <div className={styles.searchBox}>
        <img className={styles.icon} src="mercado-libre-logo.jpg" alt="logo Mercado Libre" width="70" height="70"/>
        <input type="text" placeholder="Nunca dejes de buscar" />
        <button onClick={onClick}>
          <img className={styles.icon} src="search-icon.jpg" alt="Ícono de búsqueda" width="70" height="70"/>
        </button>
      </div>
    </div>
  );
};

export default SearchBox;
